import React from 'react';



export default class AddingModel extends React.Component{
    constructor(props){
        super(props);
        this.state={

        }
    }

    componentDidMount(){
        this.setState({...this.props})
    }

    renderFormInput=()=>{

        if(typeof this.state.MyModel ==="undefined"){
            return(<div />)
        }
        return(
            <form >
                {this.state.MyModel.map((row,index)=>{
                    return(
                        <div className="form-group" key={index}>
                            <label>{row.desc}</label>
                            <input
                                type={row.type}
                                className="form-control"
                                id={row.field}
                                aria-describedby={row.field+"Help"}
                                placeholder={row.placeholder}
                            />

                        </div>
                    )
                })}
            </form>
        )
    }

    render(){
        return(
            <div className="container">
                Placeholder for Adding Model
                <p>
                    {JSON.stringify(this.state)}
                </p>
                <div className="row">
                    <div className="col col-lg-4">

                    </div>
                    <div className="col col-lg-4">
                        {this.renderFormInput()}
                    </div>
                </div>
            </div>
        )
    }
}
